function nodeFor(optName, patch) {
    var node = {children: []};
    if (optName) node.name = optName;
    for (var key in patch) {
        var value = patch[key];
        var child = {name: key};
        if (Array.isArray(value)) { // instruction
            if (value.length == 1) { // add/set
                child.style = {fontWeight: 'bold', color: Color.green};
                child.description = this.describe(value[0]);
                child.value = value[0];
                Object.addScript(child, function onSelect() {
                    inspect(this.value);
                });
            } else if (value.length == 2) { // delete
                child.style = {color: Color.red};
            } else if (value.length == 3) { // move
                child.style = {color: Color.yellow};
            }
        } else {
            var child = this.nodeFor(key, value);
        }
        node.children.push(child);
    }
    return node;
}

